import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Card from '../components/Card';
import Carousle from '../components/Carousle';

const Home = () => {
    return( 
    <div>
        <div><Navbar/></div>
        <div><Carousle/></div>
        <div className='m-4 d-flex'>
            <Card/>
            <Card/>
            <Card/>
            <Card/>
        </div>
        <div><Footer/></div>
    </div>);
}


export default Home;
